import React from 'react'
import { Polar } from 'react-chartjs-2';

class Graph extends React.Component {

  constructor (props){
    super(props)
  }

  render() {

    return (
      <Polar
        data={this.props.data}
        options={{
          legend: {
              display: true,
              position: 'right'
            },
            elements: {
              arc: {
                angle: [0.001, 0.001, 0.001, 0.001, 0.001, 0.628318530718, 0.20943951023933333, 0.001, 0.001, 0.001, 0.628318530718, 0.628318530718, 0.20943951023933333, 1.256637061436, 1.256637061436, 0.001, 0.001]
              }
            }
          }}
      />
    )
  }

}

export default Graph
